import './dashboard.css';
import { 
  BrowserRouter, 
  Routes, 
  Route 
} from 'react-router-dom';
import Home from './components/home/home';

function Dashboard() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} exact />
      </Routes>
    </BrowserRouter>
  );
}

export default Dashboard;
